So many of my snack staples are refrigerated so travel forces me to be creative. I aim to have at least 10 grams of protein and I do my best to keep them #grainfree with healthy fats. 

@parmcrisps offer a surprising amount of protein and I often pair them with sliced veggies. 

@gaea olive snack is portable, great for salty cravings. I have it with a few ounces of manchego cheese or hummus with sliced cucumber. 

@simplemills almond flour bars are grain free. 

@livingintentions sprouted almonds are delicious and more digestible than unsprouted almonds. Pair with hard boiled egg if travel is short or 1/2 cup of fage yogurt. Or for non refrigerated options manchego cheese for extra protein.

@ashasuperfoods are water lily seeds that are a great sub for more GMO options like popcorn

@rawrev healthier protein bar option

And I always travel with a bag of collagen because under emergencies it can be added to water for protein and @artisanaorganics almond butter for healthy fats. What are some of your favs?

